const { inputs, outputs, parameters } = ProcessSandbox;

const output = outputs[0];
const input = inputs[0];

const buffer = this.useBuffer(input[0]);

const mm = buffer.reduce((acc, item) => acc + item, 0);
const ff = mm / buffer.length;


output.forEach((outputChannel, channelIndex) => {
  for (
    let sampleIndex = 0;
    sampleIndex < outputChannel.length;
    sampleIndex++
  ) {
    outputChannel[sampleIndex] = ff;
  }
});
